            <div class="z-values-card-all">
                <div class="z-values-img-card">
                    <img src="images/hands.png" alt=""/>
                </div>
                <div class="z-values-text-card">
                    <h4>.</h4>
                    <p>Conversion angel investor entrepreneur first mover advantage. Handshake infographic mass market crowdfunding iteration. </p>
                </div>
            </div>
        </div>
    )
}

export default SectionValues
